import React,{useState} from "react"

const CounterFunct = (props) => {
    const [counter,setCounter] = useState(5)
    return (
      <div>
          <h1>Counter : {counter}</h1>
          <button onClick={()=>setCounter(counter+1)}>+</button>
          <button onClick={()=>setCounter(counter-1)}>-</button>
      </div>
    )
};

export default CounterFunct;
